ablica, Juscelino Kubitschek. A gest\u00e3o que deu in\u00edcio \u00e0 AMBr foi respons\u00e1vel pela elabora\u00e7\u00e3o do estatuto da entidade.<\/span><\/p><p style=\"margin: 12pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Arial, sans-serif; font-size: 10.5pt;\">No come\u00e7o funcion\u00e1vamos em salas emprestadas pela Novacap e, posteriormente, migramos para um espa\u00e7o no Edif\u00edcio Pioneiras Sociais. J\u00e1 na d\u00e9cada de 80, conquistamos a primeira sede, localizada na 913 Sul: um pr\u00e9dio de tijolinhos \u00e0 vista, projeto do arquiteto Paulo Zimbres. Ali estivemos por 22 anos - de 1985 a 2007 -, quando mudamos para a atual sede, no Setor de Clubes Sul.<\/span><\/p>","_margin":{"unit":"px","top":"35","right":"60","bottom":"30","left":"60","isLinked":false},"align_mobile":"justify","_margin_tablet":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"text-editor"}],"isInner":false}],"isInner":false},{"id":"7021462","elType":"section","settings":{"shape_divider_top":"tilt","shape_divider_top_color":"#b1edba","shape_divider_top_height":{"unit":"px","size":72},"shape_divider_top_flip":"yes","shape_divider_bottom":"tilt","shape_divider_bottom_color":"#b1edba","shape_divider_bottom_height":{"unit":"px","size":101},"shape_divider_bottom_flip":"yes","layout":"full_width"},"elements":[{"id":"19d3064","elType":"column","settings":{"_column_size":100},"elements":[{"id":"d7016b0","elType":"section","settings":{"structure":"20","layout":"full_width"},"elements":[{"id":"52e0535","elType":"column","settings":{"_column_size":50,"_inline_size":null},"elements":[{"id":"963a31d","elType":"widget","settings":{"title":"ATUALMENTE","align":"left","title_color":"#23a455","typography_typography":"custom","typography_font_family":"Poppins","typography_font_size":{"unit":"px","size":30},"typography_font_weight":"400","_margin":{"unit":"px","top":"126","right":"0","bottom":"0","left":"60","isLinked":false},"align_tablet":"left","align_mobile":"center","_margin_tablet":{"unit":"px","top":"18","right":"0","bottom":"0","left":"0","isLinked":false},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"heading"},{"id":"97ca6e6","elType":"widget","settings":{"editor":"<p style=\"margin: 12pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">\u201cUm legado hist\u00f3rico constru\u00eddo por m\u00e3os de m\u00e9dicos e m\u00e9dicas!\u201d<\/span><\/p><p style=\"margin: 12pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">O desafio de construir a nova sede come\u00e7ou na gest\u00e3o do Dr. Neri Jo\u00e3o Bottin, no dia 29 de novembro de 1998, quando foi comprado da Novacap o terreno dentro do ecossistema do Lago Parano\u00e1. Os custos de aquisi\u00e7\u00e3o do terreno foram rateados por centenas de m\u00e9dicos associados \u00e0 \u00e9poca e, por isso, \u00e9 t\u00e3o leg\u00edtima a express\u00e3o de que a AMBr \u00e9 feita de m\u00e9dicos para m\u00e9dicos.<\/span><\/p><p style=\"margin: 12pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A pedra fundamental foi fixada quatro anos depois, no dia 4 de abril de 2002, j\u00e1 na gest\u00e3o do Dr. Ranon Rodrigues, e foi sob a batuta do Dr. Jos\u00e9 Luiz Dantas Mestrinho, presidente da entidade de 2002 a 2005, que surgiram as primeiras quatro quadras de t\u00eanis, as piscinas e duas quadras de futebol.<\/span><\/p><p style=\"margin: 12pt 0cm; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Arial, sans-serif; font-size: 10.5pt;\">Em 2005, sob reg\u00eancia do Dr. Lairson Vilar Rabelo (presidente de duas gest\u00f5es, de 2005 a 2011) os avan\u00e7os dos investimentos em infraestrutura focaram na sede administrativa, tr\u00eas das seis churrasqueiras, a pista de cooper e no CACC (Centro de Atividades Cient\u00edficas e Culturais) \u2013 um centro de conven\u00e7\u00f5es vers\u00e1til, com espa\u00e7os modulares que comportam eventos cient\u00edficos, cursos, palestras e aulas pr\u00e1ticas, ajudando a cumprir a miss\u00e3o de educa\u00e7\u00e3o continuada da Associa\u00e7\u00e3o.<\/span><\/p>","_margin":{"unit":"px","top":"0","right":"60","bottom":"0","left":"60","isLinked":false},"_margin_tablet":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"text-editor"},{"id":"cb4d84c","elType":"widget","settings":{"editor":"<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">De 2011 a 2017, nas gest\u00f5es do Dr. Luciano Carvalho, surgiram o sal\u00e3o de eventos Espa\u00e7o Prime; a constru\u00e7\u00e3o da nova secretaria; tr\u00eas novas churrasqueiras; a nova lanchonete, pr\u00f3xima ao complexo de piscinas; o espa\u00e7o de eventos ao ar livre; o Bosque e duas quadras de beach tennis. Foi criado um memorial em homenagem a todos os m\u00e9dicos que dedicaram-se \u00e0 Associa\u00e7\u00e3o M\u00e9dica em suas sucessivas gest\u00f5es. Um legado hist\u00f3rico constru\u00eddo por m\u00e3os de m\u00e9dicos e m\u00e9dicas!<\/span><\/p>","_margin":{"unit":"px","top":"0","right":"60","bottom":"0","left":"60","isLinked":false},"_margin_tablet":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"text-editor"},{"id":"ab88a1a","elType":"widget","settings":{"editor":"<p>Desde janeiro de 2018, in\u00edcio da atual gest\u00e3o do Dr. Ognev Cosac, os investimentos obedecem um plano estrat\u00e9gico com duas frentes de trabalho: escutar os associados e potenciais associados para conhecer suas expectativas e assegurar a perenidade da institui\u00e7\u00e3o com investimentos que gerem receitas e garantam a manuten\u00e7\u00e3o e o crescimento da AMBr.<\/p>","_margin":{"unit":"px","top":"0","right":"60","bottom":"0","left":"60","isLinked":false},"_margin_tablet":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true},"_margin_mobile":{"unit":"px","top":"0","right":"0","bottom":"0","left":"0","isLinked":true}},"elements":[],"widgetType":"text-editor"}],"isInner":true},{"id":"efa4405","elType":"column","settings":{"_column_size":50,"_inline_size":null},"elements":[{"id":"42ecc58","elType":"widget","settings":{"image":{"url":"http:\/\/luancomunicacao.net.br\/ambr\/wp-content\/uploads\/2018\/12\/01HDR2.jpg","id":1711},"image_size":"blog-modern","space":{"unit":"%","size":100},"hover_animation":"grow","_margin":{"unit":"px","top":"50","right":"170","bottom":"0"